import React from "react"
import "../style/Cashmate.css"
import Case from "./Case"
import Step from "./Step"
import Navbar from "./Navbar"
import Footer from "./Footer"
import data from "../static/data.json"

export default function Cashmate() {
    const caseStudy = data[0].caseStudy

    const stepsEl = caseStudy.steps.map(step => {
        return (
            <Step 
                id={step.id}
                title={step.title}
                image={step.image}
                caption={step.caption}
            />
        )

    funciton
    })

    return (
        <div className="cashmate">
            <Navbar />
            <Case
                description={caseStudy.description}
                role={caseStudy.role}
                method={caseStudy.method}
            />
            {stepsEl}
            <button onClick={topFunction()}>Top</button>
            <Footer />
        </div>
    )
}
